    @Test
    public void baidu(){
        try {
            String jsonResults = "";
            // 设置搜索关键词
            String keyword = "俄乌冲突";
            for (int i = 0; i < 3;i++) {
                if (StringUtils.isNotBlank(jsonResults) && !jsonResults.equals("[]")) {
                    break;
                }
                Map map = new HashMap();
                map.put("signature", "");
                map.put("secret_id", "");
                map.put("num", 1);
                String ipResult = HttpClientUtils.httpGetString("https://dps.kdlapi.com/api/getdps", map);
                String[] split = ipResult.split(":");
                Proxy proxy = new Proxy(Proxy.Type.HTTP, new InetSocketAddress(split[0], Integer.parseInt(split[1])));
                // 发送GET请求
                Document document = Jsoup.connect("https://www.baidu.com/s?wd=" + keyword).proxy(proxy).get();

                // 解析返回结果
                Elements results = document.select("div.result");

                // 创建JSON数组
                JSONArray jsonArray = new JSONArray();

                // 遍历每个搜索结果
                for (Element result : results) {
                    // 提取标题和URL
                    String title = result.select("h3").first().text();
                    String url = result.select("h3 a").first().attr("href");
                    // 创建JSON对象
                    JSONObject jsonObject = new JSONObject();
                    jsonObject.put("title", title);
                    jsonObject.put("url", url);
                    jsonObject.put("content", result.text());
                    // 将JSON对象添加到数组中
                    jsonArray.add(jsonObject);
                }

                // 将JSON数组转换为字符串
                jsonResults = jsonArray.toJSONString();

                // 打印JSON字符串
                System.out.println(ipResult+jsonResults);
            }
            System.out.println("success:"+jsonResults);
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    @Test
    public void weibo(){
        // 1.生成httpclient，相当于该打开一个浏览器
        CloseableHttpClient httpClient = HttpClients.createDefault();
        CloseableHttpResponse response = null;
        // 2.创建get请求，相当于在浏览器地址栏输入 网址
        HttpGet request = new HttpGet("https://tophub.today/n/Om4ejl3vxE");
        // 设置请求头，将爬虫伪装成浏览器
        request.setHeader("User-Agent",
                "Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/74.0.3729.169 Safari/537.36");
        //如果有ip代理，可以加上如下代码
        Map map = new HashMap();
        map.put("signature", "");
        map.put("secret_id", "");
        map.put("num", 1);
        String ipResult = HttpClientUtils.httpGetString("https://dps.kdlapi.com/api/getdps", map);
        String[] split = ipResult.split(":");
        HttpHost proxy = new HttpHost(split[0], Integer.parseInt(split[1]));
        RequestConfig config = RequestConfig.custom().setProxy(proxy).build();
        request.setConfig(config);
        try {
            // 3.执行get请求，相当于在输入地址栏后敲回车键
            response = httpClient.execute(request);

            // 4.判断响应状态为200，进行处理
            if (response.getStatusLine().getStatusCode() == HttpStatus.SC_OK) {
                // 5.获取响应内容
                HttpEntity httpEntity = response.getEntity();
                String html = EntityUtils.toString(httpEntity, "utf-8");
                // 6.Jsoup解析html
                Document document = Jsoup.parse(html);
                // 像js一样，通过标签获取title
                Element item = document.getElementsByTag("tbody").first();
                Elements items = item.getElementsByTag("tr");
                int i =0;
                for (Element tmp : items) {
                    Element rankEle = tmp.getElementsByTag("td").first();
                    Elements textEle = tmp.select(".al").select("a");
                    JSONObject jsonObject = new JSONObject();
                    System.out.println(rankEle.text() + " " + textEle.text());
                    String herf = textEle.select("a").attr("href");
//                    System.out.println("herf:" + "https://tophub.today" + herf);
                    Elements td2 = items.get(i).getElementsByTag("td").next().next();
                    String td2Text = td2.text();
                    i++;
                    jsonObject.put("top", rankEle.text());
                    jsonObject.put("title", textEle.text());
                    jsonObject.put("url", "https://tophub.today" + herf);
                    //1. 可以在中括号内加上任何想要删除的字符，实际上是一个正则表达式
                    String regExp="[\n`~!@#$%^&*()+=|{}':;',\\[\\]<>/?~！@#￥%……&*（）——+|{}【】‘；：”“’。， 、？\uE652]";
                    //2. 这里是将特殊字符换为空字符串,""代表直接去掉
                    String replace = "";
                    //3. 要处理的字符串
                    td2Text = td2Text.replaceAll(regExp,replace);
                    jsonObject.put("level", td2Text);
                    System.out.println(jsonObject);
                }
            } else {
                // 如果返回状态不是200，比如404（页面不存在）等，根据情况做处理，这里略
                System.out.println("返回状态不是200");
                System.out.println(EntityUtils.toString(response.getEntity(), "utf-8"));
            }
        } catch (Exception e) {
            e.printStackTrace();
        } finally {
            // 6.关闭
        }
    }
